(200, 'Zwielichtstab', 18, 1, 5, 0, 'Einst gehörte er einem mächtigen Zauberer aus den Chaoswelten. Er ist sehr begehrt im Multiversum. T\'challinek übergibt ihn nicht zuletzt deswegen an Fanjo, weil er das verfluchte Teil endlich einmal eine Weile los sein will.\r\n\r\nAussehen\r\nEin Zauberstab aus Schatten, der auf einen Gedanklichen Befehl in der Hand erscheint und ebenso wieder verschwindet. Nur in manifestierter Form kann er den Besitzer wechseln.\r\n\r\nEigenschaften\r\nEr ist magisch *(+3/+3) und magisch unerspürbar (bei Zauberduellen Zaubern+30). Er durchdringt tote Materie (außer Metall). Mit ihm kann ein Zauberer Berührungszauber als Gedankenzauber vollbringen, selbst wenn sie eigentlich Geste oder Wort sind (dabei muss der Stab das Ziel berühren, außerdem ABW 5).\r\n\r\nEr vermag es gegen Entzug sämtlicher AP aller bis zu 6 Personen diese ins Zwiellicht zu ziehen (ABW 1). Dort können sie wie körperlose Geister nur von magischen Waffen verletzt werden und können Materie durchdringen. Sie können weder sprechen noch Materie verletzen. In gewisser Weise sind sie mit körperlosen Geistern vergleichbar. Darüber hinaus gleichen sie Schatten und können so auch recht schlecht entdeckt werden. Um zurück aus dem Zwielicht zu treten muss der Zauberer LP vergießen (nicht unbedingt eigene). Da das nicht auf normalem Wege geht, rät T\'challinek zu dem Zauber Verursachen von Wunden, den er zu diesem Zweck lehren würde.)', 1, '', 0, '', 0, 0, 0, NULL),
