(56, 'midgard', 'Berglöwin \"Massima\"', 'Massimas Spieldaten:\nGrad 6 (e)\nLP 18, AP 28 - TR\nSt 70, Gw 90, In t60 - B 36 - Abwehr+16; Resistenz+13/14\nAngriff: Tatze+10 (1W6-1), im Handgemenge zusätzlich Biss+10 (1W6+1), Hinterpfoten+10 (1W6-1) - Raufen+8 (1W6-1)\n_Geländelauf+15, Schleichen+17, Tarnen+17, Nachtsicht+2_\nAnspringen (= +4 ab einer Distanz von 2m auf den Tatzenangriff)\n\nBeherrschte Tricks (siehe Mys, S. 20):  \nAngreifen, Beruhigen, Suchen', '', 0, 0, 100, 150, 0),
